// SPDX-License-Identifier: MIT

pragma solidity 0.8.4;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721EnumerableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/AccessControlEnumerableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/CountersUpgradeable.sol";

/**
 * @dev {ERC721} token, including:
 *
 *  - ability for holders to burn (destroy) their tokens
 *  - a minter role that allows for token minting (creation)
 *  - a pauser role that allows to stop all token transfers
 *  - token ID and URI autogeneration
 *
 * This contract uses {AccessControl} to lock permissioned functions using the
 * different roles - head to its documentation for details.
 *
 * The account that deploys the contract will be granted the minter and pauser
 * roles, as well as the default admin role, which will let it grant both minter
 * and pauser roles to other accounts.
 */
contract VerificationCoupon is Initializable, AccessControlEnumerableUpgradeable, ERC721EnumerableUpgradeable {
    address VNF;
    using CountersUpgradeable for CountersUpgradeable.Counter;
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");

    mapping(uint256 => uint256) private expirationTime;
    mapping(uint256 => uint256) private bundle;
    mapping(uint256 => bool) bundleIdUsage;
    mapping(uint256 => bytes32) private couponContentSignature;

    CountersUpgradeable.Counter private _tokenIdTracker;
    string private _baseTokenURI;

    event MintCoupon(address owner, uint256 tokenId, uint256 expirationTime, string traceId, string ownerDid);

    event MintCouponBundle(address owner, uint256 tokenId, uint256 expirationTime, uint256 bundleId, uint256 quantity, string traceId, string ownerDid);

    event CouponContentSignature(address owner, uint256 tokenId, string traceId, string caoDid);

    event BurnCoupon(address owner, uint256 bundleId, uint256 tokenId, string traceId, string caoDid, string burnerDid);


    function initialize(string memory name, string memory symbol, string memory baseTokenURI) public initializer {
        ERC721Upgradeable.__ERC721_init(name, symbol);
        VNF = msg.sender;
        _baseTokenURI = baseTokenURI;

        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(MINTER_ROLE, msg.sender);
    }

    function isExpired(uint256 tokenId) public view returns(bool) {
        ownerOf(tokenId);
        return block.timestamp >= expirationTime[tokenId];
    }

    function isValid(uint256 tokenId, bytes32 contentSignature) public view returns(bool) {
        ownerOf(tokenId);
        return couponContentSignature[tokenId] == contentSignature;
    }

    function getCoupon(address owner) public view returns(uint256) {
        uint256 quantity = balanceOf(owner);
        require(quantity != 0, "No available tokens");

        uint256 lowestTokenId = type(uint256).max;
        uint256 currentTokenId;
        for (uint256 i = 0; i < quantity; i++) {
            currentTokenId = tokenOfOwnerByIndex(owner, i);
            if (currentTokenId < lowestTokenId) {
                lowestTokenId = currentTokenId;
            }
        }

        return lowestTokenId;
    }

    function setCouponContentSignature(uint256 tokenId, bytes32 contentSignature, string memory traceId, string memory caoDid) public {
        ownerOf(tokenId);
        require(msg.sender == VNF || _isApprovedOrOwner(msg.sender, tokenId), "ERC721Burnable: caller is not owner nor approved");
        require(couponContentSignature[tokenId] == 0, "The coupon content signature already set");
        couponContentSignature[tokenId] = contentSignature;

        emit CouponContentSignature(msg.sender, tokenId, traceId, caoDid);
    }

    function mint(address to, uint256 _expirationTime, string memory traceId, string memory ownerDid) public virtual {
        require(hasRole(MINTER_ROLE, msg.sender), "VerificationCoupon: must have a minter role to mint");
        uint256 tokenId = _tokenIdTracker.current();
        _mint(to, tokenId);
        expirationTime[tokenId] = _expirationTime;
        _tokenIdTracker.increment();

        emit MintCoupon(to, tokenId, _expirationTime, traceId, ownerDid);
    }

    function mintBundle(address to, uint256 _expirationTime, uint256 bundleId, uint256 quantity, string memory traceId, string memory ownerDid) public virtual {
        require(hasRole(MINTER_ROLE, msg.sender), "VerificationCoupon: must have a minter role to mint");
        require(!bundleIdUsage[bundleId], "The bundle id is already used");

        bundleIdUsage[bundleId] = true;
        uint256 tokenId;
        for (uint256 i = 0; i < quantity; i++) { 
            tokenId = _tokenIdTracker.current();
            _mint(to, tokenId);
            expirationTime[tokenId] = _expirationTime;
            bundle[tokenId] = bundleId;
            _tokenIdTracker.increment();
        }
        emit MintCouponBundle(to, tokenId, _expirationTime, bundleId, quantity, traceId, ownerDid);
    }

    function burn(uint256 tokenId, string memory traceId, string memory caoDid, string memory burnerDid) public virtual {
        require(msg.sender == VNF || _isApprovedOrOwner(msg.sender, tokenId), "ERC721Burnable: caller is not owner nor approved");
        uint256 bundleId = bundle[tokenId];

        _burn(tokenId);
        delete couponContentSignature[tokenId];
        delete expirationTime[tokenId];
        delete bundle[tokenId];


        emit BurnCoupon(msg.sender, bundleId, tokenId, traceId, caoDid, burnerDid);
    }

    function supportsInterface(bytes4 interfaceId) public view virtual override(AccessControlEnumerableUpgradeable, ERC721EnumerableUpgradeable) returns (bool) {
        return super.supportsInterface(interfaceId);
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return _baseTokenURI;
    }
}
